import React from "react";

const Navbar = () => {
  return (
    <nav className="bg-blue-600 text-white px-6 py-4 shadow-md flex items-center justify-between">
      <h1 className="text-xl font-bold">AI Meeting Summarizer</h1>
      <button className="bg-white text-blue-600 px-4 py-2 rounded-lg shadow hover:bg-gray-100 transition">
        Sign In
      </button>
    </nav>
  );
};

export default Navbar;
